import React from 'react';
import {Col, Row} from "react-bootstrap";

const ContactItem = () => {
    return (
            <Row>
                <Col md={4}>
                    <div className={'d-flex flex-column'}>
                        Name: Mario
                        Lastname: Mario
                    </div>
                </Col>
                <Col md={4}>
                    <div>
                        Address: mefoimsfiomsifmsif
                    </div>
                </Col>
                <Col md={4}>
                    <div>
                        Phone: 88005553535
                    </div>
                </Col>
            </Row>
    );
};

export default ContactItem;
